import React from 'react'
import $ from 'jquery'

const FileName = () => {
  $(function(){
    // bind change event to select
    $('#dynamic_select').on('change', function () {
        var url = $(this).val(); // get selected value
        if (url) { // require a URL
            window.location = url; // redirect
        }
        return false;
    });
  });
  return (
    <div>
      <select className="btn bg-light text-dark bg-light text-dark w-100 p-2 text-light"  id="dynamic_select">
                  <option className="text-dark rounded" value="https://hosters.pk/clientarea/index.php/store/flash-high-speed/basic-1?=1&billingcycle=monthly">1 Month - Rs 800.00</option>
                  <option className="text-dark rounded" value="https://hosters.pk/clientarea/index.php/store/flash-high-speed/basic-1?=1&billingcycle=quarterly">3 Months - Rs 2160.00 Save 10%</option>
                  <option className="text-dark rounded" value="https://hosters.pk/clientarea/index.php/store/flash-high-speed/basic-1?=1&billingcycle=semiannually">6 Months - Rs 3840.20 Save 20%</option>
                        <option className="text-dark rounded" value="https://hosters.pk/clientarea/index.php/store/flash-high-speed/basic-1?=1&billingcycle=annually">1 Year - Rs 5760.00 Save 40%</option>
                        <option className="text-dark rounded" value="https://hosters.pk/clientarea/index.php/store/flash-high-speed/basic-1?=1&billingcycle=biennually">2 Years - Rs 10560.00 Save 45%</option>
                        <option className="text-dark rounded" value="https://hosters.pk/clientarea/index.php/store/flash-high-speed/basic-1?=1&billingcycle=triennually">3 Years - Rs 14400.00 Save 50%</option>
      </select>
      <select className="btn bg-light text-dark bg-light text-dark w-100 p-2 text-light"  id="dynamic_select">
                  <option className="text-dark rounded" value="https://hosters.pk/clientarea/index.php/store/flash-high-speed/economy?=1&billingcycle=monthly">1 Month - Rs 800.00</option>
                  <option className="text-dark rounded" value="https://hosters.pk/clientarea/index.php/store/flash-high-speed/economy?=1&billingcycle=quarterly">3 Months - Rs 2160.00 Save 10%</option>
                  <option className="text-dark rounded" value="https://hosters.pk/clientarea/index.php/store/flash-high-speed/economy?=1&billingcycle=semiannually">6 Months - Rs 3840.20 Save 20%</option>
                        <option className="text-dark rounded" value="https://hosters.pk/clientarea/index.php/store/flash-high-speed/economy?=1&billingcycle=annually">1 Year - Rs 5760.00 Save 40%</option>
                        <option className="text-dark rounded" value="https://hosters.pk/clientarea/index.php/store/flash-high-speed/economy?=1&billingcycle=biennually">2 Years - Rs 10560.00 Save 45%</option>
                        <option className="text-dark rounded" value="https://hosters.pk/clientarea/index.php/store/flash-high-speed/economy?=1&billingcycle=triennually">3 Years - Rs 14400.00 Save 50%</option>
      </select>
      <select className="btn bg-light text-dark bg-light text-dark w-100 p-2 text-light"  id="dynamic_select">
                  <option className="text-dark rounded" value="https://hosters.pk/clientarea/index.php/store/flash-high-speed/deluxe?=1&billingcycle=monthly">1 Month - Rs 800.00</option>
                  <option className="text-dark rounded" value="https://hosters.pk/clientarea/index.php/store/flash-high-speed/deluxe?=1&billingcycle=quarterly">3 Months - Rs 2160.00 Save 10%</option>
                  <option className="text-dark rounded" value="https://hosters.pk/clientarea/index.php/store/flash-high-speed/deluxe?=1&billingcycle=semiannually">6 Months - Rs 3840.20 Save 20%</option>
                        <option className="text-dark rounded" value="https://hosters.pk/clientarea/index.php/store/flash-high-speed/deluxe?=1&billingcycle=annually">1 Year - Rs 5760.00 Save 40%</option>
                        <option className="text-dark rounded" value="https://hosters.pk/clientarea/index.php/store/flash-high-speed/deluxe?=1&billingcycle=biennually">2 Years - Rs 10560.00 Save 45%</option>
                        <option className="text-dark rounded" value="https://hosters.pk/clientarea/index.php/store/flash-high-speed/deluxe?=1&billingcycle=triennually">3 Years - Rs 14400.00 Save 50%</option>
      </select>
      <select className="btn bg-light text-dark bg-light text-dark w-100 p-2 text-light"  id="dynamic_select">
                  <option className="text-dark rounded" value="https://hosters.pk/clientarea/index.php/store/flash-high-speed/unlimited?extra=0&currency=1&billingcycle=monthly">1 Month - Rs 800.00</option>
                  <option className="text-dark rounded" value="https://hosters.pk/clientarea/index.php/store/flash-high-speed/unlimited?extra=0&currency=1&billingcycle=quarterl">3 Months - Rs 2160.00 Save 10%</option>
                  <option className="text-dark rounded" value="https://hosters.pk/clientarea/index.php/store/flash-high-speed/unlimited?extra=0&currency=1&billingcycle=monthly">6 Months - Rs 3840.20 Save 20%</option>
                        <option className="text-dark rounded" value="https://hosters.pk/clientarea/index.php/store/flash-high-speed/unlimited?extra=0&currency=1&billingcycle=monthly">1 Year - Rs 5760.00 Save 40%</option>
                        <option className="text-dark rounded" value="https://hosters.pk/clientarea/index.php/store/flash-high-speed/unlimited?extra=0&currency=1&billingcycle=monthly">2 Years - Rs 10560.00 Save 45%</option>
                        <option className="text-dark rounded" value="https://hosters.pk/clientarea/index.php/store/flash-high-speed/unlimited?extra=0&currency=1&billingcycle=monthly">3 Years - Rs 14400.00 Save 50%</option>
      </select>
    </div>
  )
}

export default FileName
